 var dummy = 1;

function click(choice) {
   var radiobutton1 = (SVGDocument.getElementById("rbSEQANNO")) ? SVGDocument.getElementById("rbSEQANNO") : SVGDocument.getElementById("dummycircle");
   var radiobutton2 = (SVGDocument.getElementById("rbSEQPLAIN")) ? SVGDocument.getElementById("rbSEQPLAIN") : SVGDocument.getElementById("dummycircle");
   var radiobutton3 = (SVGDocument.getElementById("rbSEQNONE")) ? SVGDocument.getElementById("rbSEQNONE") : SVGDocument.getElementById("dummycircle");


   if (choice == "SEQANNO") {
      radiobutton1.setAttribute("style", "visibility: visible");
      radiobutton2.setAttribute("style", "visibility: hidden");
      radiobutton3.setAttribute("style", "visibility: hidden");

      for (i = 0; i < IDS.length; i++){
         if (CMARK[i] == 1)
         {
            var tmp = SVGDocument.getElementById("c"+IDS[i]);
            tmp.setAttribute("stroke-width", "1");
         }
         if (GMARK[i] == 1)
         {
            var tmp2 = SVGDocument.getElementById("t"+IDS[i]);
            tmp2.setAttribute("fill", "gray");
         }
      }
      var seq = SVGDocument.getElementById("seq");
      seq.setAttribute("style", "visibility: visible");
      dummy = 1;
   }

   if (choice == "SEQPLAIN") {
      radiobutton1.setAttribute("style", "visibility: hidden");
      radiobutton2.setAttribute("style", "visibility: visible");
      radiobutton3.setAttribute("style", "visibility: hidden");

      for (i = 0; i < IDS.length; i++){
         var tmp = SVGDocument.getElementById("c"+IDS[i]);
         tmp.setAttribute("stroke-width", "0");
         var tmp2 = SVGDocument.getElementById("t"+IDS[i]);
         tmp2.setAttribute("fill", "black");
      }
      var seq = SVGDocument.getElementById("seq");
      seq.setAttribute("style", "visibility: visible");
      dummy = 1;
   }

   if (choice == "SEQNONE") {
      radiobutton1.setAttribute("style", "visibility: hidden");
      radiobutton2.setAttribute("style", "visibility: hidden");
      radiobutton3.setAttribute("style", "visibility: visible");

      for (i = 0; i < IDS.length; i++){
         var tmp = SVGDocument.getElementById("c"+IDS[i]);
         tmp.setAttribute("stroke-width", "0");
      }
      var seq = SVGDocument.getElementById("seq");
      seq.setAttribute("style", "visibility: hidden");
      dummy = 0;
   }
